import AddUser from "./components/Users/AddUser";
import UsersList from "./components/Users/UsersList";

function App() {
  const users = [
    { name: "Esti", age: 10 },
    { name: "Elisheva", age: 8 },
    { name: "Ishay", age: 9 },
  ];
  return (
    <div>
      <AddUser />
      <UsersList users={users} />
    </div>
  );
}

export default App;
